INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118061, "ペコリーヌとの出会い", 8, 40, 7, "青空の下で謁見", "フリーマーケット会場", 2, 2834, 10118, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118062, "マホとの出会い", 8, 40, 7, "未来の騎空団\nマスコット？", "フリーマーケット会場", 2, 2835, 10118, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118063, "アキノとの出会い", 8, 40, 7, "お嬢さまからの\n緊急依頼", "ランドソル市街地", 2, 2837, 10118, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118064, "ジュンとの出会い", 8, 40, 18, "黄金色の悩みごと", "フリーマーケット会場", 2, 4108402, 10118, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118065, "カオリとの出会い", 8, 40, 18, "白熱！　格闘大会！", "フリーマーケット会場", 2, 4107402, 10118, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118066, "ニノンとの出会い", 8, 40, 16, "祭り太鼓はオーエドの華", "オーエド町", 2, 9000227, 10118, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118067, "スズナとの出会い", 8, 40, 19, "人気者は遅れて\nやってくる", "フリーマーケット会場", 3, 2101181, 10118, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118068, "ナナカとの出会い", 8, 40, 18, "巫女・ミーツ・魔法少女", "ランドソル市街地", 3, 4109402, 10118, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118069, "キャル＆コッコロとの出会い", 8, 40, 18, "ネズ耳は二度なくなる", "フリーマーケット会場", 3, 4305402, 10118, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118070, "ユカリとの出会い", 8, 40, 18, "この出会いにカンパイ！", "ランドソル市街地", 3, 4101402, 10118, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118071, "アオイとの出会い", 8, 40, 18, "陰陽アンサンブル", "ランドソル市街地", 3, 4106402, 10118, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (91002, 20063115, 1, 5118072, "シノブとの出会い", 8, 40, 7, "運試し十番勝負！", "フリーマーケット会場", 3, 2836, 10118, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (0, 20063115, 0, 5118600, "オープニング", 0, 0, 0, "彼女たちの新たな日常", 0, 1, 0, 10118, 0, 0);
